package for_linked_list_lab2;//File: TestWCSLab2LinkedList.java/*A class for testing the WCSLinkedListCh15 class. Currently it only constructs anobject of class WCSLinkedListCh15, then adds Nodes containing Strings for various colors.*/public class TestWCSLab2LinkedList {	public static void main (String args[]) {		WCSLab2LinkedList<String> myLL = new WCSLab2LinkedList<>();		//addLIFO has return type void, which is different from		//other add methods we have been using with return type boolean		myLL.addLIFO("orange");		myLL.addLIFO("green");		myLL.addLIFO("white");		myLL.addLIFO("black");		myLL.addLIFO("brown");		myLL.addLIFO("peach");		myLL.addLIFO("green");		myLL.addLIFO("taupe");		myLL.addLIFO("green");		myLL.addLIFO("black");		myLL.addLIFO("purple");		myLL.addLIFO("green");		myLL.addLIFO("yellow");		myLL.addLIFO("purple");		myLL.addLIFO("green");		myLL.addLIFO("blue");		myLL.addLIFO("red");				System.out.println("\nThe original list is: \n"+myLL.toString());		System.out.println("\nThe number of items in the list: \n"+ myLL.getItemCount());		System.out.println("\nThe list with each element numberd : \n"+ myLL.numberedToString());				if (myLL.dataAtPos(5) != null) {			System.out.println("\nThe data of the element in the list at positon 5: \n"+ myLL.dataAtPos(5));		}else {			System.out.println("\nThere is no element at position 5: \n"+ myLL.dataAtPos(5));		}		if (myLL.dataAtPos(19) != null) {			System.out.println("\nThe data of the element in the list at positon 19: \n"+ myLL.dataAtPos(19));		}else {			System.out.println("\nThere is no element at position 19: \n"+ myLL.dataAtPos(19));		}				if (myLL.positionFirstOccurence("purple") != 0) {			System.out.println("\nThe first positon  of the element in the list  when searching for data purple: \n"+ myLL.positionFirstOccurence("purple"));		}else {			System.out.println("\nThere is no data purple stored at any position: \n"+ myLL.positionFirstOccurence("purple"));		}		if (myLL.positionFirstOccurence("sage") != 0) {			System.out.println("\nThe first positon  of the element in the list when searching for data sage: \n"+ myLL.positionFirstOccurence("sage"));		}else {			System.out.println("\nThere is no data sage stored at any position: \n"+ myLL.positionFirstOccurence("sage"));		}				System.out.println("\nThe original list is: \n"+myLL.toString());		myLL.rotate();		System.out.println("\nThe rotated list is: \n" +myLL.toString());				if (myLL.countMatches("purple") != 0) {			System.out.println("\nThe number of times data purple occured in the list: \n"+ myLL.countMatches("purple"));		}else {			System.out.println("\nThere is no data purple: \n"+ myLL.countMatches("purple"));		}		if (myLL.countMatches("sage") != 0) {			System.out.println("\nThe number of times data sage occured in the list: \n"+ myLL.countMatches("sage"));		}else {			System.out.println("\nThere is no data sage: \n"+ myLL.countMatches("sage"));		}				System.out.println("\nThe original list is: \n"+myLL.toString());		myLL.reverse();		System.out.println("\nThe reversed list is: \n" +myLL.toString());					}  //main	} //TestWCSLab2LinkedList class				